import React, { Component } from 'react';
import Shopping from '../Shopping';
import './List.scss';

class List extends Component {
	constructor(props) {
		super(props);
		this.state = {};
	}

	render() {
		return (
			<div id="list">
				{
					this.props.data.map((prod, index) => (
						<Shopping 
							key={index}
							urlImage={prod.urlImage}
							text={prod.text}
							arrTags={['q','q']}
						/>
					))
				}
			</div>
		);
	}
}

export default List;
